import React, { Fragment } from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";

import { Provider } from "react-redux";
import StartPage from "./pages/StartPage";
ReactDOM.render(
  <Provider>
    <App />
  </Provider>,
  document.getElementById("root")
);
